import React from "react";
import {BrowserRouter as Router,HashRouter,Route,Link,Switch} from 'react-router-dom'

import Index from "../../container/index";

class Menu extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <Link to='/i'>首页</Link>
            </div>
        )
    }
}
export default Menu;
